function difference(x, y) {
    var result = 0;
    if ( x > y ) {
        result = x - y;
    } else {
        result = y - x;
    }
    return result;
}

function colourChangeResult(x, y) {
    
    //console.log("checking: ", x, ", ", y);
    
    var result = {
        r: 0,
        g: 0,
        b: 0,
    };
    
    var colourOld = refCtx2.getImageData(x, y, pixelSize/2, pixelSize/2).data;
    var colourNew = refCtx1.getImageData(x, y, pixelSize/2, pixelSize/2).data;
	
    result.r = difference(colourOld[0], colourNew[0]);
    result.g = difference(colourOld[1], colourNew[1]);
    result.b = difference(colourOld[2], colourNew[2]);

    //console.log("result: ", result.r, ", ", result.g, ", ", result.b);
    
    return result;
}



